import time
class Solution(object):
    def productExceptSelf(self, nums):
        """
        :type nums: List[int]
        :rtype: List[int]

        6 min for testcase
        Tue Mar 01 16:24:00 2016
        Tue Mar 01 16:29:54 2016


        accepted:

        length = len(nums)
        res = [1]*length
        for i in range(1,length):
            res[i] = res[i-1]*nums[i-1]
        temp = 1
        for j in range(0,length)[::-1]:
            res[j] = res[j]*temp
            temp = temp * nums[j]
        return res

        """
        re = []
        for i in range(0, len(nums)):
            re.append(reduce(lambda x, y: x*y if y != nums[i] else x, nums))
        return re


